import React from 'react'
import { Row, Col, Container, Card, CardBody } from 'reactstrap';

const DetailFunc = ({func}) => {
  return (
    <div>
        {func.map(()=>(
            <Col md="4">
            <Card className="card-shadow">
                <a href="#" className="img-ho"><img className="card-img-top" alt="wrappixel kit" src={funcImage} /></a>
                <CardBody>
                    <h5 className="font-medium m-b-0">{funcEffect}</h5>
                </CardBody>
            </Card>
        </Col>
        ))}


        
    </div>
  )
}

export default DetailFunc
